messages.text:
음....스토케스틱은 RSI와 다르게 보조지표에 표현되는 라인이 두개가 있습니다. 한가지는 가격에 민감하게 반응해서 그려지는 라인*(그림상 파란색 라인)과 덜 민감하게 반응하는 라인(주황색 라인) 두개가 존재하고, 지금 같은 경우 민감하던 덜 민감하던 스토케스틱상 과매수 구간에 들어가고 민감한 라인이 꺽이기 시작하고 덜민감한 라인도 같이 꺽이게 되면 데드크로스가 됩니다.
스토케를 그려나가는 수치적인 부분은 구글링, 책 같은걸 보셔야 하고...^^;;;
해당 지표도 절대적인건 아니지만 오래 백테스팅을 하고 본인만의 경험치가 쌓이다 보면 다음 움직임에 대한 예측 경로 정도는 예상을 해볼 수 있습니다.

