text:
 급하신분들 대상 얘기인데 비캐를 예로 들어볼게요. 기존 브리핑 검색해서 보시면 알겠지만 진입자리 넓지만 체크했었고, 533 구간 오늘 터치 나왔습니다. 용기낼려면 진입 구간에서 용기냈어야한다고 봅니다. 현재는 다시 돌파 후(533 구간 돌파 후) 지지시 컵핸들을 바라볼 수 있지만 해당 상황 아니면 다시 조정을 염두에 둬야하지 않을까요.^^;
리플도 마찬가지 몇달전부터 리플 챠트 좋다고 얘기드렸고 거의 바닥 구간이었던거 같아요. 그런 자리는 용기내지 못했는데 지금은 무슨 용기를 내는건지 모르겠어요. 그냥 오른다니까 마음이 급해진걸가요....ㅠㅠ 일단 많이 오른건 눈에서 거두시고 다음 조정에 진입을 노려볼한 그런 종목을 찾아보시는게 좋습니다. 밈코 수익율 보고 지금 따라 탄다면 제 경험상 오래지 않아서 챠트봐달라는 분들 생길 가능성 높습니다...^^; 팬트하우스 입주자분들이라...
*요약하자면 포모하지 마시고 진입자리 조정 안주면 그냥 손가락빠는게 물리는거보다는 100배 1000배 좋은 선택이다...정도로.

